import classes from "../pages/work.module.css";
function SkillsBox(props) {
  return (
    <div className={classes.box}>
      <div class="box">
        <div className={classes.item}>
          <img src={props.img} alt={props.title} />
          <h3>{props.title}</h3>
          <p>{props.description}</p>
        </div>
      </div>
    </div>
  );
}
export default SkillsBox;
